import React from "react";

const MenuDropDownBox = ({ location }) => {
    const { name, region, country } = location;
    console.log(location);
    return (
        <li className="menu__drop__down__box">
            <div className="menu__drop__down__box--container">
                <h4 className="menu__drop__down__box--location__name">
                    {name}
                </h4>
                <h5 className="menu__drop__down__box--location__country">
                    {country}
                </h5>
            </div>
        </li>
    );
};

export default MenuDropDownBox;
